import { StatusBar } from 'expo-status-bar';
import { StyleSheet, Text, View, Image } from 'react-native';
import Card from './src/components/Card';

const mockItemData = {
  id: '1',
  title: 'Pizza capricciosa with mushrooms',
  description: 'Italian pizza made with baked ham, mushrooms, artichokes, tomatoes and mozzarella cheese. The mushrooms are usually mushrooms.',
  priceNew: '10',
  oldPrice: '17',
  isNew: true, 
  image: require('./assets/pizza.png'),
}

export default function App() {
  return (
    <View style={styles.container}>
      <Card mockItemData={mockItemData} />
      <StatusBar style="auto" />
    </View>
  );
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    paddingHorizontal: 10,
    backgroundColor: '#E0E0E0',
    // alignItems: 'center',
    // justifyContent: 'center',
  }}
)
